const CryptoJS = require("crypto-js");


function md5encrypt(e) {
    var a = CryptoJS.MD5('www_maomaozu_com').toString()
    return a = 0 == e ? a.substring(0, 16) : a.substring(16, 32)
}

function AESdecrypt(e, a) {
    e = CryptoJS.enc.Utf8.parse(e);
    var l = CryptoJS.AES.decrypt(a, e, {
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7,
        iv: e
    })
    return CryptoJS.enc.Utf8.stringify(l).toString()
}
data1 = ''

function aes_decrypt(e) {
    var a = md5encrypt(0).split("").reverse().join("");
    return AESdecrypt(a, e)
}
